html body {
    margin: 0;
    // padding: 0;
    color: #000000;
    -webkit-font-smoothing: antialiased;
    -moz-osx-font-smoothing: grayscale;
    overflow-x: hidden;
    // overflow: hidden;
    /* Hide horizontal scrollbar */
    // scroll-behavior: smooth;
    height: 100%;
    transition: 0.3s;
    font-family: "Circula";
    font-weight: 400;

    // background-color: rgba(250, 249, 246, 1);
    background-color: white;
    // background-color: #E2E1CA;
    // cursor: none;
}

html {
    scroll-behavior: smooth;
}

.cursor {
    position: fixed;
    top: 0;
    left: 0;
    z-index: 1000;
    // contain: layout style size;
    pointer-events: none;
    height: 20px;
    width: 20px;
    // background: #424135;
    background: black;

    border-radius: 50%;

    display: block;
}



.noise::before {
    position: fixed;
    top: 0;
    left: 0;
    width: 100%;
    height: 100%;
    content: "";
    // border: 1px solid red;
    opacity: .01;
    z-index: -1;
    pointer-events: none;
    background: url(../assets//images/noise.gif)
}

.exit-h1 {
    overflow: hidden;
}

.exit-transition {
    position: fixed;
    background: black;
    // background: #424135;
    height: 100vh;
    bottom: 0;
    left: 0;
    width: 100%;
    z-index: 1;
    height: 0;
    overflow: hidden;
    display: flex;
    justify-content: center;
    align-items: center;
    // border: 1px solid black;

    h1 {
        letter-spacing: -0.1em;
        color: #ffffff;
        padding-right: 10px;
        margin-right: -10px;
        // font-family: "Palagio";
        font-family: "EB Garamond";
        font-size: 70px;
        font-weight: 500;
        // font-style: italic;
    }

    span {
        display: inline-block;
    }
}


