.gallerycards {
    // border: 1px solid red;
    width: fit-content;
    margin-bottom: 70px;

    .coninner {
        display: flex;
        flex-direction: column;

        img {
            width: 500px;
        }

        h5 {
            font-family: "EB Garamond";
            font-size: 20px;
            font-weight: 400;
            margin: 0;
            margin-top: 19px;
        }

        .img-container {
            width: 400px;
            height: 400px;
            position: relative;
            overflow: hidden;

            &:hover {
                .hoverclass {
                    display: flex;
                }
            }

            img {
                width: 400px;
                position: absolute;
            }
        }

        .after {
            position: absolute;
            width: 100%;
            height: 100%;
            top: 0;
            right: 0;
            z-index: 1;
            background: black;
            // background: #E2E1CA;
            // background: red;
        }


        .hoverclass {
            display: none;
            position: absolute;
            width: 100%;
            height: 100%;
            top: 0;
            right: 0;
            z-index: 1;
            background: rgb(0, 0, 0, .5);
            // background: red;
            transition: all 1 ease-in-out;

            h1 {
                color: red;
            }
        }

        .word {
            // border: 1px solid black;
            overflow: hidden;

            h5 {
                transform: translateY(100%);
            }
        }
    }
}

