.ArticleCard {
    width: 350px;
    // margin-bottom: 20px;
    // margin: 10px 300px 20px 80px;
    // border: 1px solid red;
    padding: 15px;
    position: relative;
    // height: 500px;

    .inner {
        display: flex;
        flex-direction: column;
    }

    .top {
        // border: 3px solid #4E3B1F;
        border-radius: 10px;
        // padding: 15px;
        // box-shadow: 10px 5px rgba(0, 0, 0, 0.5);
